                    valueB = (b.Pass4_Deaths ?? 0) + (b.Pass5_Deaths ?? 0) + (b.Pass7_Deaths ?? 0);
                }
            }
            if (valueB === undefined || valueA === undefined) {
                return 0;
            }
            return valueB - valueA;
        });
